import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import React from "react";
import { ModuleSelectionPage } from "./Pages/Module Selection/ModuleSelectionPage"
import { Login, Register, LoginPage } from './Pages/Login/LoginPage'
import "./App.scss";
import {
  Switch,
  Route,
  useRouteMatch,
  useParams
} from "react-router-dom";
import { Nav } from "./navbar";



let totalGEMMCs = 0;

class App extends React.Component {

  render() {

       return (
         <div>
           <Switch>
             <Route exact path="/" component={LoginPage}/>
             <Route path="/module-selection" component={ModuleSelectionPage}/>
             {/* <Route path="module-plan" component={ModulePlan}/> */}
           </Switch>
         </div>
   );
    }
}



export default App;
